      <div style={{ height: window.screen.height / 2 }}>
        Hello
      </div>

      <div style={{ width: window.screen.width / 4 }}>
        hola
      <div style={{ height: window.screen.height / 2 }}>

          <Chess style={{ height: window.screen.height / 2 }} />
        </div>
      </div>
    </div>
  );
}

export default App;
